import { useState, useEffect } from 'react'
import './App.css';
import ArticleList from './Components/ArticleList'
import ParkingList from './Components/ParkingList'
import Detail from './Components/Detail'
import QRCode from "./Components/QRCode";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  useNavigate
} from 'react-router-dom';
import ParkingQRCode from './Components/QRCode';

function App() {
  const navigate = useNavigate();

  const [articles, setArticles] = useState([]);
  const [parkings, setParkings] = useState([]);
  const [value, setValue] = useState([]);

  // Modify the current state by setting the new data to
  // the response from the backend
  useEffect(() => {
    fetch('http://192.168.1.36:4000/parking', {
      'methods': 'GET',
      headers: {
        'Content-Type': 'application/json'
      }
    })
      .then(response => response.json())
      .then(response => setParkings(response))
      .catch(error => console.log(error))

  }, [])

  const handleSubmit = (e) => {
    e.preventDefault();
    navigate('/' + value);
    // do what you want with your form data
    // navigate('/2');
  }

  return (

    <Routes>
      <Route path="/" element={
        <div className="container-xxl">
          <div className="row">
            <div className="text-center">
              <h1>
                Carparking Online service
              </h1>
            </div>
            <div class='row gx-5 gy-5'>
              <div className='col-xxl ' >
                <div class="text-center">
                  <h1 >Car parking E-ticket </h1>
                  <br /><br />
                  <img src={process.env.PUBLIC_URL + "/piccomp/park1.png"} class="rounded mx-auto d-block img-fluid" />
                </div>
              </div>

              <div className='col-xxl ' >
                <div class="container-fluid">
                  <div class="text-center">
                    <h1 >Check the parking detail</h1>
                    <br /><br />
                    <h1>Parkingque</h1>
                    <div class = "form-floating mb-3">
                      <form onSubmit={handleSubmit}>
                        <label>
                          <input type="number" class='form-control' name="name" placeholder='Parkingque' value={value} onChange={e => setValue(e.target.value)} />
                        </label>
                        <br /> <br />
                        <button type="submit" class="btn btn-success btn-block">
                          "Check"
                        </button>
                      </form>
                    </div>
                  </div>
                </div>
              </div>

            </div>


          </div>

          {/* ลิสต์ คนที่มาจอด */}
          {/* <ParkingList 
            parkings={parkings} 
            /> */}

        </div>

      } />
      <Route path="/:id" element={<Detail />} />
      <Route path="/:id/qr" element={<ParkingQRCode />} />
    </Routes>

  );
}

export default App;
